func (m *Master) RegisterWorker(args *RegistArgs, reply *RegistResp) error { mu.Lock() defer mu.Unlock() workerID := uniqueID() reply.WorkerID = workerID m.timers[workerID] = time.NewTimer(time.Second * 10) log.Printf("Master > new worker %v register", workerID) // ä¸ºæ¯ä¸ªworkeråˆ†é…ä¸€ä¸ªå®šæ—¶å™¨çº¿ç¨‹ go func(worker int, timer <-chan time.Time) { <- timer // å¦‚æœå®šæ—¶å™¨è¶…æ—¶äº† mu.Lock() defer mu.Unlock() delete(m.timers, worker) // åˆ é™¤å®šæ—¶å™¨ for jobid, wid := range m.mapWorker { if wid == worker { m.mapState[jobid] = IDLE delete(m.mapWorker, jobid) log.Printf("Master > map worker %v time out", worker) } } for jobid, wid := range m.reduceWorker { if wid == worker { m.reduceState[jobid] = IDLE delete(m.reduceWorker, jobid) log.Printf("Master > reduce worker %v time out", worker) } } }(workerID, m.timers[workerID].C) return nil
