func (m *Master) WorkerFinished(args *RequestArgs, reply *ResponseType) error { mu.Lock() defer mu.Unlock() if args.JobType == MAP { _, ok := m.mapWorker[args.TaskNum] if !ok { return fmt.Errorf("Map Worker timeout, job : %v", m.fileNames[args.TaskNum]) } m.mapState[args.TaskNum] = COMPLETE delete(m.mapWorker, args.TaskNum) fmt.Printf("Map job" + m.fileNames[args.TaskNum] + " finish\n") } else if args.JobType == REDUCE { _, ok := m.reduceWorker[args.TaskNum] if !ok { return fmt.Errorf("Reduce worker timeout, job : %v", args.TaskNum) } m.reduceState[args.TaskNum] = COMPLETE delete(m.reduceWorker, args.TaskNum) fmt.Printf("Reduce job" + strconv.Itoa(args.TaskNum) + " finish\n") } return nil
